import '../Css/Footer.css';
import { Link } from "react-router-dom";

function Footer(){
    return(
        <footer classname="footer bg-dark py-3">
            <div classname="container text-center">
                <div classname="row">
                    <div classname="col-12">
                        <div className="footerText">
                            <p classname="">&copy; 2024|  4 Wheel Barbers. All rights reserved.</p>
                            <a classname="" href="/terms&conditions">Terms & Conditions</a>
                            <a classname="footerLink" href="/privacy_policy">Privacy Policy</a>
                        </div>
                    </div>
                </div>
            </div>        
        </footer>
    )
}

export default Footer;
